import React from "react";
import "../css/Footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <p>Privacy Policy</p>
      <p id="justice">Justice Web Design</p>
      <p>&copy;2021</p>
    </div>
  );
};

export default Footer;
